// ==UserScript==
// @name                leetcode提交音效
// @name:zh-CN          leetcode提交音效
// @namespace           http://tampermonkey.net/
// @version             0.0.2
// @description         leetcode提交后，提示通过或失败有不同的音效
// @description:zh-CN   leetcode提交后，提示通过或失败有不同的音效
// @author              kkopite
// @match               https://leetcode.cn/problems/*
// @require             https://code.jquery.com/jquery-3.6.0.slim.min.js
// @icon                https://www.google.com/s2/favicons?sz=64&domain=leetcode.com
// @grant               none
// ==/UserScript==

(function () {
  'use strict'

  const success = [
    '通过',
  ]

  const fail = [
    '解答错误',
    '超出时间限制'
  ]
  const audio = document.createElement('audio')
  document.body.append(audio)

  const s = 'data:audio/mpeg;base64,'
  const f = 'data:audio/mpeg;base64,'

  const observer = new MutationObserver((mutations) => {
    mutations.forEach(mutation => {
      if (mutation.type === 'childList') {
        const text = mutation.target.innerText
        const result = text.split('\n')[1]
        if (success.includes(result)) {
          console.log('==> 通过')
          audio.src = s
          audio.load()
          audio.play()
        } else if (fail.includes(result)) {
          console.log('==> 失败')
          audio.src = f
          audio.load()
          audio.play()
        }
      }
    })
  })

  setTimeout(() => {
    const el = document.querySelector('[data-key="submissions-content"]')
    observer.observe(el, {
      childList: true,
      subtree: true
    })
  }, 5000);

})()